import React from 'react';
import { Route,Switch } from 'react-router-dom';
import  SignIn  from './authorization/sign_in';
import Rout from './authorization'

export const Root = (props : any) => {
    return (
        <Switch>
            <Route exact path = "/">
                <SignIn />
            </Route>
            <Route path="/topics">
                <SignIn />
            </Route>
        </Switch>
    );
}
